import React from 'react'

let count = 0

const Socials = () => {
  return (
    <div>
      <ul>
        {
            socials.map(item => {
                <li key={count++}>
                    <a href={item.link}>
                        {
                            item.icon
                        }
                    </a>
                </li>
            })
        }
      </ul>
    </div>
  )
}

export default Socials

const socials = [
    {media:'Instagram', link:'#', icon:'Ig'},
    {media:'LinkedIn', link:'#', icon:'In'},
    {media:'X', link:'#', icon:'X'},
    {media:'Youtube', link:'#', icon:'▷'}
]
